import React from "react";
import { Card, Input, Dropdown, Radio, Button, MenuProps } from "antd";
const items = [
  {
    key: "1",
    label: India,

  },{
    key:"2",
    label:US ,
  }
];
const UserDetail = () => {
  return (
    <div>
      <Card
        borderd={true}
        style={{
          width: 800,
          height: 900,
          borderColor: "black",
          justifyContent: "center",
          alignContent: "center",
          display: "flex",
        }}
      >
        <Input
          placeholder="FirstName"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Input
          placeholder="LastName"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Input
          placeholder="Contact"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Dropdown
          menu={{ items }}
          placement="bottomLeft"
          style={{ lineHeight: 3, marginBottom: 20 }}
          arrow={{ pointAtCenter: true }}
        >
          <Button>Country</Button>
        </Dropdown>
        <Input
          placeholder="Email"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Input placeholder="City" style={{ lineHeight: 3, marginBottom: 12 }} />
        isActive : <Radio />
      </Card>
    </div>
  );
};

export default UserDetail;
